import manageJss from "@microsoft/fast-jss-manager-react";
import { ButtonStyles } from "@microsoft/fast-components-styles-msft";
import MSFTButton, { ButtonAppearance, ButtonSlot, } from "./button";
import buttonSchema from "./button.schema";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Button = manageJss(ButtonStyles)(MSFTButton);
export { Button, ButtonAppearance, ButtonSlot, buttonSchema, };
